(10, '0000-00-00 00:00:00', 'LangCodeFormat.core.hint', '1', '', 1, '<en>Language codes format.\r\nThere are folowing types of codes:\r\n1. Global - common used words like Save, Delete etc. Format: -code\r\n2. Database fields. Format: DatabseName.FieldName\r\n3. Links. Format: Code.ModuleName.link\r\n4. Buttons. Format: Code.ModuleName.button\r\n5. Tips (text on pages). Format: Code.ModuleName.tip\r\n6. Titles. Format: Code.ModuleName.title\r\n7. Options in slect lists or lists of checkboxes and radioboxes. Format: Code.ModuleName.option\r\n8. System message. Fromat: module.method.type.messageCode. type is the type of message: 1. err - error 2. msg - message 3. fatalerror - fatal error\r\n</en><fr>Language codes format.\r\nThere are folowing types of codes:\r\n1. Global - common used words like Save, Delete etc. Format: -code\r\n2. Database fields. Format: DatabseName.FieldName\r\n3. Links. Format: Code.ModuleName.link\r\n4. Buttons. Format: Code.ModuleName.button\r\n5. Tips (text on pages). Format: Code.ModuleName.tip\r\n6. Titles. Format: Code.ModuleName.title\r\n7. Options in slect lists or lists of checkboxes and radioboxes. Format: Code.ModuleName.option\r\n8. System message. Fromat: module.method.type.messageCode. type is the type of message: 1. err - error 2. msg - message 3. fatalerror - fatal error\r\n</fr>', '', '', '', ''),
