(515, '2006-05-02 07:48:01', 'TitleRegisterTip.resource.tip', 'root', 'root', 4, '<fr>Qui sommes-nous ?  \r\n  Isabelle DAHAN est consultante dans les domaines de l''Internet et du Marketing immobilier depuis l''année 2000, elle a fondé son expérience en exerçant pendant plus de 10 ans le métier d''Ingénieur Conseil dans une société de services en informatique. Isabelle DAHAN est aussi gérante de la société Coptima (s.a.r.l. créée en juin 2001) délivrant des prestations immobilières, membre fondatrice de la Fédération Française de l''Immobilier sur Internet (F.F.2.I.) et Créatrice du site portail &quot;www.mon-immeuble.com&quot; consacré à la copropriété (avril 2000).\r\n\r\n \r\n  Que faisons-nous ? \r\n \r\n  Nous intervenons auprès des groupes immobiliers, des cabinets de syndics, des entreprises du bâtiment et de l''immobilier et de la presse spécialisée. Nous proposons notre savoir faire : formation, consultations en matière de communication et de marketing immobilier, informations immobilières, analyse des besoins en matière de solutions Internet, conception et réalisation de sites portails d''entreprise\r\n</fr><en>Please register if it is your first posting into our website</en>', '', '', '', ''),
