(1110, '2008-05-19 16:51:33', 'BackLinkTextIntro.submission.tip', 'root', 'root', 4, '<ru>Для того, чтобы ссылка на Ваш сайт была утверждена и доступна в нашем каталоге, Вам необходимо разместить одну из наших ссылок  на странице Вашего сайта с адресом , который Вы укажете ниже в поле &quot;Страница с обратной ссылкой на наш сайт&quot;. Внимание! Эта страница должна быть доступна на главной старнице Вашего сайта. Мы проверяем наличие обратной ссылки каждые 3 дня. Отсутствие нашей ссылки на указанной странице Вашего сайта приведет к автоматическому блокированию информации о Вашем сайте в каталоге в течение 10-ти дней.</ru><en>In order to have your website listed please add one of our links to your website and enter below the link to your links page.</en><fr>Veuillez ajouter un lien retour vers notre site afin de valider votre référencement dans notre annuaire lien dur.</fr>', '', '', '', ''),
(1111, '2007-09-06 21:11:57', 'BackLinkText.submission.tip', 'root', 'root', 4, '<en><b>Ссылка:</b> http://vsevesti.com\r\n<br/>\r\n<b>Название:</b> Новости и объявления вашего города - ВсеВести.com\r\n<br/>\r\n<b>Описание:</b>Cистема поиска региональных новостей и объявлений, где вы сможете найти ежеминутно обновляемую информацию из тысяч источников, опубликовать свои новости и объявления, обсудить события или создать собственную ленту новостей за считанные минуты.</en><ru><b>Ссылка:</b> http://vsevesti.com\r\n<br/>\r\n<b>Название:</b> Новости и объявления вашего города - ВсеВести.com\r\n<br/>\r\n<b>Описание:</b>Cистема поиска региональных новостей и объявлений, где вы сможете найти ежеминутно обновляемую информацию из тысяч источников, опубликовать свои новости и объявления, обсудить события или создать собственную ленту новостей за считанные минуты.</ru><ua><b>Ссылка:</b> http://vsevesti.com\r\n<br/>\r\n<b>Название:</b> Новости и объявления вашего города - ВсеВести.com\r\n<br/>\r\n<b>Описание:</b>Cистема поиска региональных новостей и объявлений, где вы сможете найти ежеминутно обновляемую информацию из тысяч источников, опубликовать свои новости и объявления, обсудить события или создать собственную ленту новостей за считанные минуты.</ua>', '', '', '', ''),
