(1331, '2008-10-02 23:05:25', 'WebSiteInternalLinks.submission.tip', 'root', 'root', 4, '<fr>Nous pouvons ajouter des liens pointant vers des pages internes de votre site internet. Merci de renseigner dans ce champs la liste des liens selon le format suivant: <br/>\r\nUrl lien;Titre du lien\r\n<br/>Veuillez rentrer une URL par ligne.<br/>\r\nExemple:\r\n<br/>\r\nhttp://www.monsite.com/page1.html;Page1 titre<br/>\r\nhttp://www.monsite.com/page2.html;Page2 titre<br/></fr><en>We can show links to your website internal pages. Please add in this field the list of links in the folowing format: <br/>\r\nLink url;Link titlte\r\n<br/>Please one link per line.<br/>\r\nExample:\r\n<br/>\r\nhttp://www.mywebsite.com/page1.html;Page1 title<br/>\r\nhttp://www.mywebsite.com/page2.html;Page2 title<br/>\r\n</en><ru>Мы разрешаем размещать ссылки на внутренние страницы Вашего сайта. Пожалуйста укажите ссылки на основные разделы Вашего сайта в следующем формате: <br/>\r\nАдрес ссылки;Название ссылки\r\n<br/>Одна ссылка на строку.<br/>\r\nПример:\r\n<br/>\r\nhttp://www.mywebsite.com/page1.html;Название страницы 1<br/>\r\nhttp://www.mywebsite.com/page2.html;Название  страницы 1<br/>\r\n</ru>', '', '', '', ''),
