(1646, '2008-01-26 21:24:01', 'ConfirmRequestTip.resource.tip', 'root', 'root', 4, '<fr>The property owner will receive your contact information when you click &quot;Send&quot; button. But if the property owner does not reply to your request within 24 hours we can send your message to real estate agents who can offer you more properties. Please note that in this case your contact information is confidential and is available only to those agents that you validate. We remind you with an email each time you have an offer from an agent. Your contact information is sent only after your validation. Please check the checkbox below to allow us to send your request to other agents in case if property owner does not reply within 2 hours.</fr><en>You will be contacted directly by property agent or owner. \r\nBut if you do not receive any reply within 24 hours we can send your no-obligation inquiry to real estate agents who can offer you more properties. Please note that your contact information is confidential and is available only to registered agents who paid for our services. \r\n<br/><br/>\r\nPlease check the checkbox below to allow us to send your inquiry to other agents in case if you do not have a reply within 24 hours.</en>', '', '', '', ''),
