(1947, '2008-12-01 17:07:17', 'ManageWebsitesForSubmissionIntro.submission.tip', 'root', 'root', 4, '<de>Sie können Webkatalogsz die sich nicht in der Liste befinden hinzufügen. Nach Bestätigung sind diese für alle Benutzer sichtbar.</de><en>You can add here the directory that you can not find and you would like to use it. All directories added here are shared with other members after validation.</en><fr>Vous pouvez ajouter des annuaires qui ne figurent pas dans la liste. Après validation, ceux-ci seront visibles par tous les utilisateurs.</fr><ru>Если Вы не нашли в нашей системе каталог, где Вы бы хотели зарегистрировать свой сайт, Вы можете добавить его здесь и использовать в своей работе. После утверждения каталога администратором он будет доступен всем участникам системы. Вам также доступны ресурсы, добавленные другими пользователями или нашими администраторами.</ru>', '', '', '', ''),
(1948, '2008-12-09 11:46:04', 'NoWebSiteForSubmissionFound.submission.tip', 'root', 'root', 4, '<de>Keine Angaben</de><en>No website or directory found</en><fr>Aucun résultat</fr><ru>Сайты или каталоги не найдены</ru>', '', '', '', ''),
(1949, '2008-12-10 19:33:32', 'EditWebSitesIntro.submission.tip', 'root', 'root', 4, '<de>Hier finden Sie die Liste Ihrer Internetseiten.</de><en>you will find below the list of your websites</en><fr>Vous trouvez ci-dessous la liste de vos sites internet.</fr><ru>На этой странице представлены Ваши сайты и проекты для продвижения. Нажмите на названии сайта для его регистрации в каталогах, обмена ссылками с другими сайтами или регистрации статей и объявлений.\r\n<br/>\r\nПосле утверждения операторами, Ваш сайт будет доступен в нашем <a href=''/ru-i-web-directory.html'' target=''_blank''>каталоге сайтов</a> и в каталоге системы обмена ссылками. Также после утверждения, Вы начнете получать email уведомления, если кто-то пожелает обменяться ссылками с Вами. <br/>\r\nУтверждение не требуется для регистрации Вашего сайта в каталогах.</ru>', '', '', '', ''),
