(2067, '2008-03-23 21:43:47', 'MyResourceOffersTendersPaid.resource.link', 'root', 'root', 4, '<en>[ View inquiries ]</en><ru>[ Увидеть заказы ]</ru>', '', '', '', ''),
(2068, '2008-12-15 11:49:44', 'EditResourceOffersIntrotender.resource.tip', 'root', 'root', 4, '<de>Hier finden Sie Ihre Kostenvoranschlag Anfragen. Sie können für jede Anfrage sehen wer Ihr Kontakt gekauft hat.</de><en>This is your inquiries page. You can see who has buy your contact.</en><fr>Vous trouvez ci-dessous vos demandes de devis. Vous pouvez consulter pour chaque devis le nombre de personnes ayant achetés votre contact.</fr><ru><p>На этой странице Вы найдете список всех заказов добавленных Вами.</p>\r\n<p>Наши операторы проверяют каждый заказ в отдельности. Они могут связаться с Вами для уточнения данных. После утверждения заказа, уведомление о нем отправляется поставщикам по email или SMS и он доступен в базе заказов поставщиков.</p>\r\n\r\n<p>Для просмотра подробной информации и статистики, нажмите на названии выбранного заказа. <br/>\r\nМаксимальное время активности заказа - 30 дней. Заказ автоматически заблокируется, после достижения указанного вами максимального количества предложений.<br/>\r\nЕсли Вы желаете остановить заказ раньше нажмите на ссылку &quot;Заблокировать&quot;. Для измнения заказы свяжитесь с нашими операторами.<br/>\r\n</p>\r\n\r\n<p>Внимание! Ваша контактная информация по заказу конфиденциальна и доступна только Вам, нашим операторам и ограниченному колличеству поставщиков, которые утвердили заказ и заплотили за доступ к нему.</p></ru>', '', '', '', ''),
(2069, '2008-03-23 22:56:18', 'ResourceOffer.ResourceOfferComments', 'root', 'root', 4, '<en>Admnistrators comments</en><ru>Дополнительные данные от опреаторов</ru>', '', '', '', ''),
