(2075, '2008-03-25 22:21:10', 'ResourceCategoryDefaultIntro.resource.tip', 'root', 'root', 4, '<en>More intro text about adding enquiry into this category</en><ru><p>Это значит, что Ваш заказ будет отправлен только поставщикам, которые занимаются этим видом деятельности в регионе, который Вы выберите ниже.</p>\r\n<p>Если Вам также необходимы товары или услуги из других категорий, пожалуйста, добавьте отдельные заказы для каждой категории.</p>\r\n<p><b>Заказ, добавленный в нашей системе, ни к чему Вас не обязывает. Это просто заявка о том, что вам необходимо. </b></p></ru>', '', '', '', ''),
