(2387, '2008-12-11 10:32:00', 'GetWebsiteInfo.submission.tip', 'root', 'root', 4, '<de><br/>\r\nWir bieten Ihnen eine automatische Erkennung Ihrer Internetseite an. Diese kann einige Minuten dauern.\r\n<br/>\r\n<br/>\r\nWünschen Sie eine automatische Erkennung Ihrer Internetseite? Wenn ja, muss das Feld einen Hacken enthalten.\r\n<br/></de><en>At this step we will try to get your website title, description and keywords automatically. It may take <b>more then 2 minutes</b> for some websites. Would you like to get your website info automatically?</en><fr><br/>\r\nNous vous proposons une détection automatique de votre site. Celà peut prendre plusieurs minutes en fonction du site internet.\r\n<br/>\r\n<br/>\r\nSouhaitez-vous la détection automatique de votre site? Si oui, la case ci-dessous doit être cochée.\r\n<br/></fr><ru>Мы попытаемся автоматически получить название, описание и ключевые слова вашего сайта. Для некоторых сайтов это может занять <b>более одной минуты</b>. Желаете ли Вы получить данные Вашего сайта автоматически?</ru>', '', '', '', ''),
