(2394, '2009-11-16 17:13:43', 'AddWebSiteIntro.submission.tip', '11365480442009090300213830q111', 'root', 4, '<en>On this page you can register your website to start web promotion: links exchange, directories and search engines submission, articles submission, ads submission, search engine positions etc.\r\n\r\n\r\nYour website will be validated within few hours and available on our websites directory and in our links exchange database.\r\n<font color=&quot;red&quot;>Please enter carefully your email address. It will be used to send email reminds for links exchange and advertising requests on your website.</font>\r\n\r\n\r\n\r\nIf your website is a directory you can add it in our directories database after your registration on this page. Just click &quot;My directories&quot; in your account.\r\n</en><fr>On this page you can register your website to start web promotion: links exchange, directories and search engines submission, articles submission, ads submission, search engine positions etc.\r\n\r\n\r\nYour website will be validated within few hours and available on our websites directory and in our links exchange database.\r\n<font color=&quot;red&quot;>Please enter carefully your email address. It will be used to send email reminds for links exchange and advertising requests on your website.</font>\r\n\r\n\r\n\r\nIf your website is a directory you can add it in our directories database after your registration on this page. Just click &quot;My directories&quot; in your account.\r\n</fr><nl>Op deze pagina kunt u zich aanmelden om uw website te promoten: uitwisselen van links, aanmelden bij zoekmachines, opgeven van artikelen, advertenties, positionering zoekmachines, etc.\r\n\r\nUw website zal binnen een paar uren worden bekeken en beschikbaar zijn op onze inhoudsopgave en in ons wederszijdse linkbestand.\r\n<font color=&quot;red&quot;>Graag uw email adres zorgvuldig opgeven. Het wordt gebruikt om email reminders te sturen voor het uitwisselen van links en advertentie aanvragen op uw website.</font>\r\n\r\n\r\n\r\nIf your website is a directory you can add it in our directories database after your registration on this page. Just click &quot;My directories&quot; in your account.\r\n</nl>', '', '', '', ''),
