(2404, '2008-12-20 22:51:44', 'UserEmailValidationIntro.core.tip', 'root', 'root', 4, '<en>We have just sent you an email with a code. Please read your inbox and enter the code here to validate your email address.</en><ru>Мы отправили Вам сообщение с кодом, который Вам необходимо ввести в этой форме для подтверждения Вашего email адреса.</ru>', '', '', '', ''),
