(2406, '2009-01-24 23:51:03', 'OwnerDomainFieldComments.core.tip', 'root', 'root', 4, '<en>If you do not have a domain name yet you can enter it later</en><ru>Домен (доменное имя) это адрес Вашего сайта в интернет.<br/><br/>\r\nПри создании  сайта Вы можете бесплатно зарегистрировать поддомен в одном из доступных ниже доменов или подключить свой зарегистрированный ранее домен. \r\n<br/><br/>\r\nМы рекомендуем зарегистрировать свой домен, так как это гораздо лучше для поискового продвижения и существенно поможет при дальнейшем развитии сайта. Ваш собственный домен это торговое имя сайта, которое становится дороже с ростом популярности сайта.\r\n<br/><br/>\r\n<b>Внимание!</b> При оплате за хостинг по любому тарифному плану мы предоставляем возможность бесплатной регистрации доменов в зоне &quot;.ru&quot;. Таким образом, Вы получаете хостинг и домен сайта в зоне &quot;.ru&quot; по стоимости ниже цены регистрации одного только домена  у большинства регистраторов.  При этом домен продлевается бесплатно при ежегодном продлении хостинга.\r\n<br/><br/>\r\nВы можете зарегистрировать и подключить домен после создания сайта.\r\n</ru>', '', '', '', ''),
(2407, '2009-04-04 19:46:49', 'NS.core.tip', 'root', 'root', 4, '<en>Our NS servers:<br>\r\nns364648.ovh.net<br>\r\nsdns1.ovh.net\r\n</en><ru>У Вас есть 2 способа настройки домена:\r\n<br/>\r\n1. (рекомендованый) Получить специальный файл и установить его на текущий хостинг Вашего домена: <a href=''{url}bridge'' target=''_blank''>скачать файл</a>. Этот вариант лучше для поисковой оптимизации, так как позволяет иметь разные IP адреса для каждого сайта.\r\n<br/>\r\n2. Изменить A запись в панеле Вашего регистратора на наш IP: 91.121.209.227\r\n<br/>\r\n(помните, что сайт будет доступен через 24 часа после измнения NS адресов)\r\n<br/>\r\n\r\n</ru>', '', '', '', ''),
