(2423, '2009-01-25 13:27:25', 'OwnerPaymentAfterRegistration.core.tip', 'root', 'root', 4, '<en>Your website is created. Please pay for the hosting.</en><ru>Ваш сайт создан. Пожалуйста, выберите тарифный план и оплатите за хостинг.\r\n<br/><br/>\r\nВы можете открыть сайт бесплатно, но только после утверждения содержимого сайта нашими администраторами.  Нажмите “Оплатить позже” чтобы закончить бесплатную регистрацию сайта.\r\n<br/><br/>\r\n<b>Внимание!</b> При оплате за хостинг по любому тарифному плану мы предоставляем возможность бесплатной регистрации доменов в зоне &quot;.ru&quot;. Таким образом, Вы получаете хостинг и домен сайта в зоне &quot;.ru&quot; по стоимости ниже цены регистрации одного только домена  у большинства регистраторов.  При этом домен продлевается бесплатно при ежегодном продлении хостинга.\r\n</ru>', '', '', '', ''),
(2424, '2008-12-21 23:05:45', 'OwnerIsPaid.core.tip', 'root', 'root', 4, '<en>Thank you for the payment.</en><ru>Ваш сайт оплачен. Спасибо.</ru>', '', '', '', ''),
