(2432, '2009-04-15 02:17:00', 'EditOwnersIntro.core.tip', 'root', 'root', 4, '<en>This is the main panel for websites management.</en><ru>Это панель управления Вашими сайтами.\r\n<br/><br/>\r\nНажмите на ссылку &quot;Настройки&quot;, чтобы настроить фукнции сайта, дизайн сайта, параметры получения платежей, установить рекламные блоки или коды статистики.\r\n<br/><br/>\r\nУправлять содержимым сайта Вы можете прямо на его страницах. Для этого не нужна специальная панель. \r\n<br/>\r\nВыберите ссылку &quot;Управление страницами&quot; для изменения текстов существующих страниц, добавления новых страниц, проведения поисковой оптимизации, добавления или изменения категорий каталогов статей и ссылок.\r\nЭто панель управления Вашими сайтами.\r\n<br/><br/>\r\nНажмите на ссылку &quot;Настройки&quot;, чтобы настроить фукнции сайта, дизайн сайта, параметры получения платежей, установить рекламные блоки или коды статистики.\r\n<br/><br/>\r\nИспользуя простой менеджер задач Вы можете вести свои задачи по работе с каждым сайтом. Задачи распределены по приоритетам и времени исполнения. Используйте ссылку &quot;Задачи&quot; для добавления новой задчи или просмотра текущих.\r\n<br/><br/>\r\nВы также можете сохранять различные заметки по каждому сайту. Заметками могут быть например ссылки на источники информации для сайта, контактные данные авторов статей, коды банеров или статистики или любые другие заметки на память. Для добавления заметок нажмите на ссылку &quot;Заметки&quot;.\r\n<br/><br/>\r\nПодбор ключевых слов <a target=&quot;_blank&quot; href=&quot;https://adwords.google.com/select/main?cmd=KeywordSandbox&quot;>На Google</a> <a target=&quot;_blank&quot; href=&quot;http://direct.yandex.ru/&quot;>На Yandex</a></ru>', '', '', '', ''),
(2433, '2008-12-27 01:55:12', 'Owner.OwnerStatus', 'root', 'root', 4, '<en>Website status</en><ru>Статус сайта</ru>', '', '', '', ''),
(2434, '2008-12-27 02:04:05', 'OwnerStatusNote.core.tip', 'root', 'root', 4, '<en>Please do not make website live until you set all settings and make a text on first page. An empty website may affect your search engine optimization process.</en><ru>Пожалуйста не включайте сайт до его окончательной настройки и ввода текста на первой странице. Активация пустого сайта может существенно помешать при поисковой оптимизации.</ru>', '', '', '', ''),
