(2473, '2009-08-30 18:17:09', 'SEOPageAliasComment.seo.tip', 'root', 'root', 4, '<en>It is important to use keywords in page link. If you leav this field empty it is generated from page title.</en><ru>Используйте ключевые слова в адресе страницы. Адрес страницы можно не указывать. Он автоматически создается из названия страницы.</ru>', '', '', '', ''),
(2474, '2009-11-18 21:32:37', 'SEOPageMetaTitleComment.seo.tip', 'root', 'root', 4, '<en>Page title is important for search engine optimization. Recommended length limit: 60 characters. It is highly recommended to use your target keywords in title. <a target=&quot;_blank&quot; href=&quot;https://adwords.google.com/select/main?cmd=KeywordSandbox&quot;>Keywords research in Google</a></en><fr>Page title is important for search engine optimization. Recommended length limit: 60 characters. It is highly recommended to use your target keywords in title. <a target=&quot;_blank&quot; href=&quot;https://adwords.google.com/select/main?cmd=KeywordSandbox&quot;>Keywords research in Google</a></fr><nl>Page title is important for search engine optimization. Recommended length limit: 60 characters. It is highly recommended to use your target keywords in title. <a target=&quot;_blank&quot; href=&quot;https://adwords.google.com/select/main?cmd=KeywordSandbox&quot;>Keywords research in Google</a></nl><ru>Заголовок выводится в теге title. Он чрезвычайно важен для поисковой оптимизации. Обязательно используйте ключевые слова в заголовке. Рекомендованная максимальная длина: 60 символов. Подбор ключевых слов <a target=&quot;_blank&quot; href=&quot;https://adwords.google.com/select/main?cmd=KeywordSandbox&quot;>в Google</a> <a target=&quot;_blank&quot; href=&quot;http://wordstat.yandex.ru/&quot;>в Yandex</a></ru>', '', '', '', ''),
