(2510, '2009-01-25 13:32:16', 'OwnerPaymentIntro.core.tip', 'root', 'root', 4, '<en>You can pay or upgrade website hosting package here.</en><ru>На этой странице Вы можете оплатить за хостинг сайта или изменить тарифный пакет.\r\n<br/><br/>\r\n<b>Внимание!</b> При оплате за хостинг по любому тарифному плану мы предоставляем возможность бесплатной регистрации доменов в зоне &quot;.ru&quot;. Таким образом, Вы получаете хостинг и домен сайта в зоне &quot;.ru&quot; по стоимости ниже цены регистрации одного только домена  у большинства регистраторов.  При этом домен продлевается бесплатно при ежегодном продлении хостинга.\r\n</ru>', '', '', '', ''),
