(2525, '2009-02-01 14:11:41', 'OwnerAdministratorsEmailsExample.core.tip', 'root', 'root', 4, '<en>Website reminds and contact form messages are sent to emails in this field. You can enter one email or several emails delimited by &quot;;&quot;. Example: email1@mail.com;email2@mail.com;email3@mail.com</en><ru>На эти адреса отправляются копии уведомлений сайта и сообщения с контактной формы. Можно ввести один адрес или несколько адресов разделенные точкой с запятой. Пример: email1@mail.ru;email2@mail.ru;email3@mail.ru</ru>', '', '', '', ''),
(2526, '2009-02-01 15:24:44', 'Owner.OwnerHTML', 'root', 'root', 4, '<en>Template HTML code</en><ru>HTML код шаблона</ru>', '', '', '', ''),
(2527, '2009-02-01 15:42:55', 'OwnerHTMLDescription.core.tip', 'root', 'root', 4, '<en>Variables used in templates:\r\n<br/><br/>\r\n{body} - This is the main variable to show page content. WARNING! The website can not work without this variable.\r\n<br/><br/>\r\n{title} - pages title\r\n<br/><br/>\r\n{description} - description meta tag value\r\n<br/><br/>\r\n{keywords} - keywords meta tag value</en><ru>Переменные для шаблона:\r\n<br/><br/>\r\n{body} - это обязательное значение для вывода оснвоного содержимого страницы. ВНИМАНИЕ! Без этой переменной сайт не будет работать.\r\n<br/><br/>\r\n{title} - заглавие страницы для тега title\r\n<br/><br/>\r\n{description} - мета описание страницы\r\n<br/><br/>\r\n{keywords} - ключевые слова для мета тега\r\n<br/><br/>\r\nВы можете использовать любые ссылки в своем шаблоне. Вы сможете ввести текст для каждой ссылки после входа на страницу ссылки.\r\n<br/><br/>\r\nПредопределенные ссылки:\r\n<br/>\r\nСсылка на страницу входа в систему: /myhome\r\n<br/></ru>', '', '', '', ''),
