(2544, '2009-04-26 20:36:50', 'SEOPageMetaDescriptionComment.seo.tip', 'root', 'root', 4, '<en>The maximum number of characters in meta description is 160. It is recomended to use all words used in page title. However meta description must not be identical to page title.</en><ru>Мета описение это текст, который будет выводиться как краткое описние сайта в результатах поиска в поисковиках. Стандартом для мета описания является длина в 160 знаков. Обязательно используйте в мета описании все слова из заголовка. При этом текст описания должен отличатся от заголовка.</ru>', '', '', '', ''),
(2545, '2009-04-26 20:39:03', 'SEOPageTitleComment.seo.tip', 'root', 'root', 4, '<en>The name of the link to this page in website menu or sitemap.</en><ru>Это название ссылки на эту страницу в меню сайта.</ru>', '', '', '', ''),
