(3227, '2010-06-20 20:28:46', '-secslogan', 'root', 'mas', 4, '<ua>Коротка інформація про компанію, слоган про те, яка крута у вас компанія і що потрібно звертатися тільки до вас :)</ua><ru>КРАТКАЯ ИНФОРМАЦИЯ О КОМПАНИИ, РАССКАЗ О ТОМ, КАКИЕ ВЫ КРУТЫЕ И ЧТО ОБРАЩАТЬСЯ НУЖНО ТОЛЬКО К ВАМ И НИ К КОМУ ДРУГОМУ :)</ru><us>Brief information about company, A story about what you twist and what to pay NEED ONLY TO YOU AND NO ONE ELSE:)</us><en>КРАТКАЯ ИНФОРМАЦИЯ О КОМПАНИИ, РАССКАЗ О ТОМ, КАКИЕ ВЫ КРУТЫЕ И ЧТО ОБРАЩАТЬСЯ НУЖНО ТОЛЬКО К ВАМ И НИ К КОМУ ДРУГОМУ :)</en>', '', '', '', ''),
