(3536, '2011-03-21 23:03:34', 'Product.err.OneLangRequired', 'root', 'bestmoments', 4, '<ru>Ошибка! Должны быть заполнены поля "Название подарка", "Краткое описание" и "Полное описание подарка" хотя бы на одном языке</ru><ua>Ошибка! Должны быть заполнены поля "Название подарка", "Краткое описание" и "Полное описание подарка" хотя бы на одном языке</ua><en>Ошибка! Должны быть заполнены поля "Название подарка", "Краткое описание" и "Полное описание подарка" хотя бы на одном языке</en>', '', '', '', ''),
