(3403, '2011-03-01 16:41:11', 'GiftCard.bm.title', 'root', 'bestmoments', 4, '<ru>Gift Card на {value} грн.</ru><ua>Gift Card на {value} грн.</ua><en>Gift Card for {value} UAH.</en>', '', '', '', ''),
(3404, '2011-03-01 16:42:58', 'GiftCardIntro.bm.tip', 'root', 'bestmoments', 4, '<ru>Прекрасный подарок для тех, кто сомневается в том, что ему выбрать. Сертификат на {value} подарочных гривен.</ru><ua>Чудовий подарунок для тих, хто має сумніви щодо того, що йому обрати. Сертифікат на {value} подарункових гривень.</ua><en>Gift Certificate for {value} gift UAH is the perfect gift for those, who have doubts about what to choose.</en>', '', '', '', ''),
(3528, '2011-03-01 16:44:56', '-uah', 'root', 'bestmoments', 4, '<ru>грн.</ru><ua>грн.</ua><en>UAH.</en>', '', '', '', ''),
(3405, '2011-03-01 16:47:50', 'GiftCardFullInfo.bm.title', 'root', 'bestmoments', 4, '<ru>Подарочная карта Gift Card позволяет везунчику, который получил подарок выбрать любое впечатление на выбор – экстремальные гонки или полеты, мастер классы, развивающие творческие навыки, SPA процедуры. Все зависит только от его предпочтений!</ru><ua>Подарункова картка Gift Card дозволяє щасливчику, що одержав подарунок, обрати будь-яке враження на вибір - екстремальні перегони або польоти, майстер-класи, що розвивають творчі навички, SPA процедури. Все залежить лише від його побажань!</ua><en>Gift Card allows the lucky one who got the gift, to choose any impression on the range – extreme racing or flying, master-classes that develop creative skills, SPA procedures. Everything depends on his wishes!</en>', '', '', '', ''),
(3532, '2011-03-14 11:57:25', 'successUnsubscribe.bm.msg', 'root', 'bestmoments', 4, '<ru>Вы успешно отписались от новостной рассылки!</ru><ua>Ви відписалися від розсилки новин!</ua><en>You have successfully unsubscribed from the newsletter!</en>', '', '', '', ''),
