(3408, '2011-03-03 11:37:22', 'howtoorder.bm.tip', 'root', 'bestmoments', 4, '<ru>Как заказать</ru><ua>Як замовити</ua><en>How to order</en>', '', '', '', ''),
(3409, '2011-03-03 11:38:02', 'askquestion.bm.tip', 'root', 'bestmoments', 4, '<ru>Задать вопрос</ru><ua>Поставити запитання</ua><en>Put a question</en>', '', '', '', ''),
(3410, '2011-03-01 16:49:07', 'AdditionalInfo.bm.tip', 'root', 'bestmoments', 4, '<ru>Дополнительная информация</ru><ua>Додаткова інформація</ua><en>Additional information</en>', '', '', '', ''),
(3411, '2011-03-01 16:49:27', 'gcaddtext.bm.tip', 'root', 'bestmoments', 4, '<ru>Активировать подарочную карту можно на сайте или по телефону. Вы можете выбрать несколько подарков на одну Gift Card или воспользоваться несколькими картами для приобретения одного\r\nподарка. При активации карты, то есть при покупке выбранного Вами подарка, система списывает сумму, равную номиналу карты. Таким образом, Вы можете приобрести подарок, стоимость которого выше номинала карты, доплатив разницу.</ru><ua>Активувати подарункову карту можна на сайті або за телефоном. Ви можете обрати декілька подарунків на одну Gift Card або скористатися декількома картками для придбання одного подарунку. При активації картки, тобто при купівлі обраного Вами подарунку, система списує суму, що дорівнює номіналу картки. Таким чином, Ви можете придбати подарунок, вартість якого вище номіналу картки, доплативши різницю.</ua><en>You can activate gift card online or by phone. You can choose some gifts for one Gift Card or use several cards to purchase a gift. When you activate the card, that means the purchase of the chosen gift, the system writes off an amount equal to the nominal value of the card. Thus, you can purchase a gift that costs more than nominal value of the card having paid the difference.</en>', '', '', '', ''),
(3531, '2011-03-03 13:32:17', 'JoinCompany.bm.err', 'root', 'bestmoments', 4, '<ru>Введите, пожалуйста, название компании!</ru><ua>Введіть, будь ласка, назву компанії!</ua><en>Please, enter the company name!</en>', '', '', '', ''),
(3412, '2011-03-03 11:40:41', 'AdditionalOrder.bm.tip', 'root', 'bestmoments', 4, '<ru>Заказ</ru><ua>Замовлення</ua><en>Order</en>', '', '', '', ''),
(3413, '2011-03-03 11:41:16', 'OrderInfo.bm.tip', 'root', 'bestmoments', 4, '<ru>Нажать кнопку «Купить» и перейти в корзину, чтобы выбрать способ оплаты, доставки и оставить контактную информацию для подтверждения заказа. Также Вы можете оформить заказ по телефону.</ru><ua>Натиснути кнопку «Купити» і перейти до кошику, щоб обрати спосіб оплати, доставки й залишити контактну інформацію для підтвердження замовлення. Також Ви можете оформити замовлення за телефоном. </ua><en>Press the button «Buy» and go to the basket to select a mode of payment, delivery and leave contact information to confirm the order. You can also make your order by phone.</en>', '', '', '', ''),
(3414, '2011-03-03 11:41:47', 'AdditionalPay.bm.tip', 'root', 'bestmoments', 4, '<ru>Оплата</ru><ua>Оплата</ua><en>Payment</en>', '', '', '', ''),
(3415, '2011-03-01 18:25:14', 'PayInfo.bm.tip', 'root', 'bestmoments', 4, '<ru><li>Наличными курьеру при доставке</li>\r\n<li>Наличными у нас в офисе</li>\r\n<li>Банковский перевод</li>\r\n<li>WebMoney</li>\r\n<li>Банковскими картами VISA или Master Card</li></ru><ua><li>Готівкою кур&rsquo;єру під час доставки</li>\r\n<li>Готівкою у нас в офісі</li>\r\n<li>Банківський переказ</li>\r\n<li>WebMoney</li>\r\n<li>Банківськими картками VISA або Master Card</li></ua><en><li>In cash to courier</li>\r\n<li>In cash in our office</li>\r\n<li>Bank transfer</li>\r\n<li>WebMoney</li>\r\n<li>Bank cards VISA or Master Card</li></en>', '', '', '', ''),
(3416, '2011-03-03 11:42:05', 'AdditionalTerm.bm.tip', 'root', 'bestmoments', 4, '<ru>Срок действия сертификата</ru><ua>Термін дії\r\n сертифікату</ua><en>Certificate’s validity period</en>', '', '', '', ''),
(3417, '2011-03-03 11:43:40', 'TermInfo.bm.tip', 'root', 'bestmoments', 4, '<ru>Впечатление можно активировать в течение 6 месяцев.</ru><ua>Враження можна активувати протягом 6 місяців.</ua><en>The impressions can be activated within 6 months.</en>', '', '', '', ''),
(3418, '2011-03-03 11:43:57', 'AdditionalDeliv.bm.tip', 'root', 'bestmoments', 4, '<ru>Доставка</ru><ua>Доставка</ua><en>Delivery</en>', '', '', '', ''),
(3419, '2011-03-01 18:17:57', 'DelivInfo.bm.tip', 'root', 'bestmoments', 4, '<ru><li><strong>Курьер по Киеву</strong> 30 грн</li>\r\n<li><strong>Электронный сертификат</strong> 0 грн</li>\r\n<li><strong>Получение в офисе</strong> 0 грн</li></ru><ua><li><strong>Кур''єр по Києву</strong> 30 грн</li>\r\n<li><strong>Електронний сертифікат</strong> 0 грн</li>\r\n<li><strong>Одержання в офісі</strong> 0 грн</li></ua><en><li><strong>Courier in Kyiv</strong> 30 UAH</li>\r\n<li><strong>E-certificate</strong> 0 UAH</li>\r\n<li><strong>Receiving in office</strong> 0 UAH</li></en>', '', '', '', ''),
(3420, '2011-03-03 11:45:27', 'AdditionalUrgentOrder.bm.tip', 'root', 'bestmoments', 4, '<ru>Срочный заказ</ru><ua>Термінове замовлення</ua><en>Urgent order</en>', '', '', '', ''),
(3421, '2011-03-03 11:45:46', 'UrgentOrderInfo.bm.tip', 'root', 'bestmoments', 4, '<ru>Выберите электронный сертификат и мы вышлем Вам подарок в электронном виде по почте. Самый быстрый способ получить подарок!</ru><ua>Виберіть електронний сертифікат і ми надішлемо Вам подарунок в електронному вигляді поштою. Найшвидший спосіб отримати подарунок!</ua><en>Choose an e-certificate and we will send you a gift in electronic mail. The fastest way to get a gift!</en>', '', '', '', ''),
(3422, '2011-02-05 01:45:02', 'RequestSent.bm.tip', 'root', 'bestmoments', 4, '<ru>Спасибо, Ваш вопрос отправлен!</ru><ua>Дякуємо, Ваше запитання відправлено!</ua><en>Спасибо, Ваш вопрос отправлен!</en>', '', '', '', ''),
