(3511, '2011-03-01 18:52:19', 'SuccessOrder.bm.msg', 'root', 'bestmoments', 4, '<ru>Поздравляем Вас с приобретением прекрасного подарка!\r\n\r\nВ течение дня наш менеджер свяжется с Вами для подтверждения заказа.</ru><ua>Вітаємо Вас з придбанням чудового подарунка! \r\n\r\nПротягом дня наш менеджер зв''яжеться з Вами для підтвердження замовлення.</ua><en>Congratulations on purchasing the perfect gift! During the day, our manager will contact you to confirm your order.</en>', '', '', '', ''),
